                    user: function(value) { //valueitemDOM
                        if (!new RegExp("^[a-zA-Z0-9_\u4e00-\u9fa5\\s]+$").test(value)) {
                            return '';
                        }
                        if (/(^\_)|(\__)|(\_+$)/.test(value)) {
                            return '\'_\'';
                        }
                        if (/^\d+\d+\d$/.test(value)) {
                            return '';
                        }
                    },
                    //layedit 
                    layedit: function(value) {
                        var list = document.querySelectorAll("*[lay-filter='editor']");
                        if (list.length > 0) {
                            $.each(list, function() {
                                if ($(this).data('editor') === 2 || $(this).data('editor') === '2') {
                                    var id = $(this).prop('id');
                                    return layui.layedit.sync(window['editor' + id])
                                }
                            })
                        }
                    },
                    pass: [/^[\S]{6,18}$/, '618'],
                    zipcode: [/^\d{6}$/, ""],
                    chinese: [/^[\u0391-\uFFE5]+$/, ""] //
                    ,
                    money: [/(^[1-9]([0-9]+)?(\.[0-9]{1,2})?$)|(^(0){1}$)|(^[0-9]\.[0-9]([0-9])?$)/, ",!"],
